import React from 'react';
import './Contact.css';

const name = "Katrina Campbell";
const avatar = 'https://randomuser.me/api/portraits/women/19.jpg';
const online = false;

function isOnline() {
    if (online === true) {
      return <p class="status-online">Online</p>
    } else {
      return <p className="status-offline">Offline</p>
    }
  }

  const Contact = () =>  (
    <div class="Contact">
      <img src={avatar} class="avatar" />
      <div>
        <h4 >{name}</h4>
        {isOnline(online)} 
      </div> 
    </div>
  );

export default Contact;
